import React, { Component } from "react";
import axiosInstance from "../axiosApi";
import {
    Button,
    Section,
    ModalHeader,
    ModalBody,
    ModalFooter,
    Form,
    FormGroup,
    Input,
    Label
} from 'reactstrap'


class Home extends Component {
    constructor(props) {
        super(props);

    }


    render() {
        return (
            <section className="vh-100">
                <div className="row">
                    <div className="col-12">
                        Hello { localStorage.getItem('access_token')}!
                    </div>
                </div>
            </section>

        )
    }
}
export default Home;
